import React from 'react';
import Layout from '../../layout/Layout/Layout';
import styles from './Subscription.module.scss';
const Subscription = () =>{
    return(
        <Layout className={styles.container}>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/uM8iac8hEPU" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </Layout>
    )
}

export default Subscription;
